import React from 'react'
import Button from './Button'

const Container = () => {
  
  const onClick = (event) => {
    event.preventDefault()
  }

  return (
    <div className='container'>
      <form>
        <Button 
          onClick={onClick}
          text='BUTTONES'
        />
      </form>
    </div>
  )
}

export default Container
